Mongoose toObject<p>I have the following Mongoose Schema: </p>

<pre><code>const UserSchema = new Schema({
  email: {
    type: String,
    minlength: 1,
    required: true,
    trim: true,
    unique: true,
    validate: {
      validator: isEmail,
      message: '{VALUE} is not a valid email.',
    },
  },
  emailPhrase: {
    type: String,
  },
  tokens: [
    {
      access: {
        type: String,
        required: true,
      },
      token: {
        type: String,
        required: true,
      },
    },
  ],
});
</code></pre>

<p>And the following pre-hook: </p>

<pre><code>UserSchema.pre('save', function (next) {
  const user = this;

  if (!user.toObject().tokens[0].token) {
    // do something
    next();
  } else {
    // do something else 
    next();
  }
});
</code></pre>

<p>The issue is, even when the <code>tokens</code> property is completely empty, the first case (do something) doesn't run. What am I doing wrong here? </p>

